import { DragDropContext, Droppable } from "react-beautiful-dnd";
import "./App.css";
import { useDebugValue } from "react";

function App() {
  return (
    <div>
      <DragDropContext>
        <Droppable droppableId="droppable">
          {(provided) => (
            <div {...provided.droppableProps} ref={provided.innerRef}>
              {(provided) => (
                <div>
                  <div>1</div>
                  <div>2</div>
                  <div>3</div>
                </div>
              )}
            </div>
          )}
        </Droppable>
      </DragDropContext>
    </div>
  );
}

export default App;
